import React, { useState } from 'react';
import styles from './Request.module.css'

export default function Request({ requests }) {
  return (
    <div className={styles.listContainer}>
      <h3>Your Requests</h3>
      <ul>
        {requests.map((req, i) => (
          <li key={i} className={styles.listItem}>
            {req.type} - {req.status}
          </li>
        ))}
      </ul>
    </div>
  );
}
